import React, {useContext, useState} from 'react';
import {LocalizationContext} from '../../utils/language.utils';
import ImagePicker from 'react-native-image-crop-picker';
import GroupSettings from '../../components/Group/GroupSettings.component';

const GroupSettingsPage = ({route, navigation}) => {
	const {groupID} = route.params;

	const {translations, initializeAppLanguage} = useContext(LocalizationContext);
	initializeAppLanguage();

	const imageDummy = [
		'',
		'',
		'',
		'',
		'',
		'',
		''
	];

	const groupDataDummy = {
		id: groupID,
		image: '',
		name: 'Hollywoo',
		description: 'Previously called Hollywood',
		allowSearchByName: true
	};

	const groupMembersDummy = [{
		id: 'USER0001',
		image: imageDummy[0],
		joinDate: '2020-01-20',
		name: 'Bojack Horseman',
		role: 'MEMBER'
	}, {
		id: 'USER0002',
		image: imageDummy[1],
		joinDate: '2020-01-25',
		name: 'Diane Nguyen',
		role: 'TREASURER'
	}, {
		id: 'USER0003',
		image: imageDummy[2],
		joinDate: '2020-04-29',
		name: 'Todd Chavez',
		role: 'MEMBER'
	}, {
		id: 'USER0004',
		image: imageDummy[3],
		joinDate: '2020-04-12',
		name: 'Princess Carolyn',
		role: 'LEADER'
	}, {
		id: 'USER0005',
		image: imageDummy[4],
		joinDate: '2020-05-07',
		name: 'Mr. Peanutbutter',
		role: 'MEMBER'
	}, {
		id: 'USER0006',
		image: imageDummy[5],
		joinDate: '2020-01-13',
		name: 'Sarah Lynn',
		role: 'MEMBER'
	}, {
		id: 'USER0007',
		image: imageDummy[6],
		joinDate: '2020-04-10',
		name: 'Judah Mannowdog',
		role: 'TREASURER'
	}, {
		id: 'USER0008',
		image: '',
		joinDate: '2020-03-15',
		name: 'Charley Witherspoon',
		role: 'MEMBER'
	}, {
		id: 'USER0009',
		image: '',
		joinDate: '2020-02-28',
		name: 'Wanda Pierce',
		role: 'MEMBER'
	}];

	const [groupData, setGroupData] = useState(groupDataDummy);
	const [groupMembers, setGroupMembers] = useState(groupMembersDummy);

	const changeGroupData = (groupName, groupDescription) => {
		setGroupData({
			...groupData,
			name: groupName,
			description: groupDescription
		});
		alert(`Change group data, group name: ${groupName}, group description: ${groupDescription}`);
	};

	const changeGroupPicture = (image) => {
		setGroupData({
			...groupData,
			image: image.data
		});
		ImagePicker.clean().then(() => {
			alert('Change group picture');
		}).catch(e => {
			console.log(e);
		})
	};

	const deleteProfilePicture = () => {
		setGroupData({
			...groupData,
			image: ''
		});
		alert('Delete group picture');
	};

	const pickerOption = {
		compressImageQuality: 0.8,
		cropping: true,
		cropperCancelText: translations['DropdownChangePicture']['CANCEL'],
		cropperChooseText : translations['DropdownChangePicture']['SAVE'],
		cropperCircleOverlay: true,
		cropperToolbarTitle: translations['DropdownChangePicture']['SELECT_PROFILE_PICTURE'],
		height: 480,
		includeBase64: true,
		mediaType: 'photo',
		useFrontCamera: true,
		width: 480
	};

	const openLibrary = () => {
		ImagePicker.openPicker(pickerOption).then(image => {
			changeGroupPicture(image);
		}).catch(e => {
			console.log(e);
		});
	};

	const openCamera = () => {
		ImagePicker.openCamera(pickerOption).then(image => {
			changeGroupPicture(image);
		}).catch(e => {
			console.log(e);
		});
	};

	const onChangeGroupPictureDropdown = (value) => {
		switch (value) {
			case 'TAKE_PHOTO':
				openCamera();
				break;
			case 'CHOOSE_FROM_LIBRARY':
				openLibrary();
				break;
			case 'DELETE_PROFILE_PICTURE':
				deleteProfilePicture();
				break;
			default:
				console.log('Error!');
				break;
		}
	};

	const toggleAllowSearchByName = () => {
		setGroupData({
			...groupData,
			allowSearchByName: !groupData.allowSearchByName
		});
		alert(`Toggle allow search by name: ${groupData.allowSearchByName}`);
	};

	const goBack = () => {
		navigation.replace('GroupList');
	};

	const openDrawer = () => {
		navigation.openDrawer();
	};

	const editGroupMember = () => {
		navigation.navigate('EditGroupMember', {
			groupID: groupID
		});
	};

	const createEvent = () => {
		alert('Unhandled event');
	};

	const leaveGroup = () => {
		navigation.replace('GroupList');
		alert(`Leave group ${groupID}`);
	};

	const deleteGroup = () => {
		navigation.replace('GroupList');
		alert(`Delete group ${groupID}`);
	};

	return (
		<GroupSettings
			contentText={translations['GroupSettings']}
			confirmLeaveGroupText={translations['ConfirmLeaveGroup']}
			confirmDeleteGroupText={translations['ConfirmDeleteGroup']}
			dropdownChangePictureText={translations['DropdownChangePicture']}
			groupData={groupData}
			groupMembers={groupMembers}
			onChangeGroupPictureDropdown={onChangeGroupPictureDropdown}
			toggleAllowSearchByName={toggleAllowSearchByName}
			changeGroupData={changeGroupData}
			editGroupMember={editGroupMember}
			createEvent={createEvent}
			leaveGroup={leaveGroup}
			deleteGroup={deleteGroup}
			openDrawer={openDrawer}
			goBack={goBack} />
	);
};

export default GroupSettingsPage;